snippet.sync_client:
package com.example.usage;

import com.seed.websocket.SeedWebsocketClient;

public class Example {
    public static void main(String[] args) {
        SeedWebsocketClient client = SeedWebsocketClient
            .builder()
            .build();

        client.realtime().health();
    }
}

